import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './RegisterPage.css';
import useRegister from '../../hooks/useRegister';

const RegisterPage = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [loading, setLoading] = useState(false);
  const [showPassword, setShowPassword] = useState(false);
  const [showConfirmPassword, setShowConfirmPassword] = useState(false);

  const { registerUser } = useRegister();

  const handleRegister = async (e) => {
    e.preventDefault();

    if (!email || !password || !confirmPassword) {
      alert('Please fill out all fields.');
      return;
    }

    if (password !== confirmPassword) {
      alert('Passwords do not match.');
      return;
    }

    setLoading(true);
    await registerUser(email, password);
    setLoading(false);
  };

  return (
    <div className="register-page">
      <div className="register-container">
        <div className="register-illustration">
          <div className="illustration-content">
            <h1>Join ResearchConnect</h1>
            <p>Collaborate with researchers worldwide to create impactful projects</p>
            <div className="illustration-image">
              <span role="img" aria-label="Science illustration">üî¨</span>
            </div>
          </div>
        </div>

        <div className="register-card">
          <div className="card-header">
            <h1 className="register-title">Create Account</h1>
            <p className="register-subtitle">Join a research room today</p>
          </div>

          <form className="register-form" onSubmit={handleRegister}>
            <div className="input-group">
              <label htmlFor="email">Email Address</label>
              <div className="input-wrapper">
                <span className="input-icon">‚úâÔ∏è</span>
                <input
                  className="input-field"
                  type="email"
                  id="email"
                  value={email}
                  onChange={(e) => setEmail(e.target.value)}
                  placeholder="you@example.com"
                  required
                  autoComplete="username"
                />
              </div>
            </div>

            <div className="input-group">
              <label htmlFor="password">Password</label>
              <div className="input-wrapper">
                <span className="input-icon">üîí</span>
                <input
                  className="input-field"
                  type={showPassword ? "text" : "password"}
                  id="password"
                  value={password}
                  onChange={(e) => setPassword(e.target.value)}
                  placeholder="Create a password"
                  required
                  autoComplete="new-password"
                />
                <button 
                  type="button" 
                  className="password-toggle"
                  onClick={() => setShowPassword(!showPassword)}
                  aria-label={showPassword ? "Hide password" : "Show password"}
                >
                  {showPassword ? "üôà" : "üëÅÔ∏è"}
                </button>
              </div>
            </div>

            <div className="input-group">
              <label htmlFor="confirmPassword">Confirm Password</label>
              <div className="input-wrapper">
                <span className="input-icon">üîí</span>
                <input
                  className="input-field"
                  type={showConfirmPassword ? "text" : "password"}
                  id="confirmPassword"
                  value={confirmPassword}
                  onChange={(e) => setConfirmPassword(e.target.value)}
                  placeholder="Re-enter your password"
                  required
                  autoComplete="new-password"
                />
                <button 
                  type="button" 
                  className="password-toggle"
                  onClick={() => setShowConfirmPassword(!showConfirmPassword)}
                  aria-label={showConfirmPassword ? "Hide password" : "Show password"}
                >
                  {showConfirmPassword ? "üôà" : "üëÅÔ∏è"}
                </button>
              </div>
            </div>

            <div className="password-strength">
              <div className={`strength-bar ${password.length > 0 ? 'active' : ''}`}></div>
              <div className={`strength-bar ${password.length > 5 ? 'active' : ''}`}></div>
              <div className={`strength-bar ${password.length > 8 ? 'active' : ''}`}></div>
              <div className={`strength-bar ${password.length > 11 ? 'active' : ''}`}></div>
              <span className="strength-text">
                {password.length === 0 ? '' : 
                 password.length < 6 ? 'Weak' :
                 password.length < 9 ? 'Medium' : 'Strong'}
              </span>
            </div>

            <div className="terms-agreement">
              <input type="checkbox" id="terms" required />
              <label htmlFor="terms">
                I agree to the <Link to="/terms">Terms of Service</Link> and <Link to="/privacy">Privacy Policy</Link>
              </label>
            </div>

            <button className="register-button" type="submit" disabled={loading}>
              {loading ? (
                <span className="loading-indicator">
                  <span className="loading-spinner" /> Creating account...
                </span>
              ) : (
                'Register'
              )}
            </button>

            <div className="social-register">
              <p className="divider"><span>Or sign up with</span></p>
              <div className="social-buttons">
                <button type="button" className="social-button google">
                  <span role="img" aria-label="Google">G</span>
                </button>
                <button type="button" className="social-button microsoft">
                  <span role="img" aria-label="Microsoft">M</span>
                </button>
                <button type="button" className="social-button orcid">
                  <span role="img" aria-label="ORCID">O</span>
                </button>
              </div>
            </div>

            <p className="redirect-link">
              Already have an account? <Link to="/login">Sign in</Link>
            </p>
          </form>
        </div>
      </div>
    </div>
  );
};

export default RegisterPage;
